__NUXT_JSONP__("/svet/mesto/ad-dakhla", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s){return {data:[{place:[{id:h,id_state:i,name:j,population:106277,area:16.47,altitude:12,slug:k,information_chatgpt:a,coordinates:[{latitude:23.6848,longitude:-15.9579}],biggest:"yes",type_place:c,id_image_cover:a,id_image_hero:a,affiliate:[{name:l,value:e}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:d,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2024-03-02T11:05:40.678938+00:00",name_original:a,setting_top:e}],imagePlace:[],placeState:[{tld:".eh",name:"Západní Sahara",area:252120,population:597339,slug:m,id_continent:f,information_chatgpt:"\u003Cp\u003EZápadní Sahara, také známá jako Západní Saharská demokratická republika, je neuznaný stát nacházející se na západním okraji Sahary. V současné době je Západní Sahara vleklým konfliktem mezi Marokem a polovojenským hnutím Fronta Polisario, které usiluje o nezávislost.\u003C\u002Fp\u003E\n\u003Cp\u003EToto území je velmi řídce osídlené a z velké části se skládá z pouště. Nicméně přestože toto území není příliš atraktivní pro turisty, nabízí návštěvníkům úžasné možnosti pro dobrodružné expedice, jako je například off-road jízda, písečné surfování nebo pouštní trekking.\u003C\u002Fp\u003E\n\u003Cp\u003EZápadní Sahara je také domovem několika kmenů, jako jsou například Tuaregové, kteří mají své vlastní zvyky a tradice, a turisté mohou navštívit tradiční trhy a osady, aby se dozvěděli více o jejich kultuře a způsobu života.\u003C\u002Fp\u003E\n\u003Cp\u003EPokud se chystáte na návštěvu Západní Sahary, je důležité si uvědomit, že území je v konfliktu a může být nebezpečné pro turisty. Většina cestovních kanceláří nedoporučuje návštěvu této oblasti kvůli bezpečnostním rizikům a neexistenci infrastruktury pro turisty.\u003C\u002Fp\u003E\n\u003Cp\u003EPřestože je Západní Sahara neuznaným státem, jeho území a kultura mají své jedinečné kouzlo a mohou být zajímavou destinací pro dobrodružné cestovatele, kteří jsou připraveni na extrémní podmínky a respektují místní zvyklosti a kulturu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité mít na paměti, že v této oblasti se vyskytují i nebezpečné teroristické skupiny, takže je důležité řídit se pokyny místních úřadů a cestovních kanceláří a sledovat aktuální bezpečnostní situaci před návštěvou.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:a,phone_prefix:"+212",coordinates:[{latitude:"24.2155",longitude:"-12.8858"}],people_religion:[{name:"Islám",value:"99%"},{name:"Křesťanství",value:"1%"},{name:"Judaismus",value:n},{name:"Další náboženství",value:n}],people_nationality:[{name:"Berbeři",value:"40%"},{name:"Maurové",value:"30%"},{name:"Fulbové",value:"10%"},{name:"Toubouvé",value:"7%"},{name:"Senufové",value:"5%"},{name:"Další",value:"8%"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným cestovním dokladem pro vstup do Západní Sahary. Je nutné mít platný cestovní pas.",date_update:b},{name:"Cestovní pas",value:"Pro vstup do Západní Sahary je nutné mít platný cestovní pas.",date_update:b},{name:"Vízum",value:"Pro vstup do Západní Sahary není potřeba víza pro občany České republiky a ostatních zemí Evropské unie, pokud pobyt nepřesáhne 90 dnů. Ostatní národnosti by měly zkontrolovat vízovou povinnost s příslušnými orgány Západní Sahary.",date_update:b},{name:"Očkování",value:"Při vstupu do Západní Sahary není vyžadováno žádné očkování. Nicméně, doporučuje se být očkován proti základním nemocem jako jsou tetanus, hepatitida A a B a být chráněn proti malárii a průjmovým onemocněním.",date_update:b},{name:"Cestovní pojištění",value:"Při vstupu do Západní Sahary není nutné mít cestovní ani zdravotní pojištění. Nicméně, doporučuje se mít platné cestovní pojištění, které pokryje náklady na lékařskou péči a repatriaci v případě zdravotních potíží nebo nehody.",date_update:b},{name:"Bezpečnostní situace",value:"Západní Sahara je konfliktní oblastí s nevyřešenými územními spory a nízkou úrovní bezpečnosti. Cestování mimo města a vesnic je zakázáno a turistům se doporučuje zůstat na hlavních silnicích a v turistických zařízeních. Vzhledem k nevyzpytatelné bezpečnostní situaci v zemi, doporučuje se sledovat zpravodajství a konzultovat aktuální bezpečnostní doporučení s místními úřady před cestou do této oblasti.",date_update:b},{name:"Další informace",value:"Vzhledem k nízké úrovni infrastruktury, doporučuje se cestovat do Západní Sahary s dostatečnou zásobou potravin a vody. Turisté by měli respektovat místní zvyklosti a tradice, jako jsou například oblékání v souladu s místními mravy a náboženskými předpisy. V oblasti se používají marocký dirham a západosaharská peseta, a je třeba mít s sebou hotovost, protože ne všechna místa přijímají platební karty.",date_update:b}],type_place:o,id_image_cover:g,id_image_hero:g,id_city_main:p,affiliate:[{name:l,value:e}],mpz:"EH",alerts:a,zoom:[{google:q,booking:q}],ids_neighboring_countries:[{id:62},{id:137},{id:151}],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:i,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-02T11:05:26.667745+00:00",name_original:a,currency:[{code:"MAD",name:"saharský dinár"}],setting_top:e}],imageState:[{id:g,name:m,source:"\u002Fworld\u002Fstates\u002F",type:o,author:"unsplash.com\u002F@danborn",created_at:"2023-05-06T09:27:42.033044+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:2,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:r,date_update:r,author_create:s,author_update:s}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-02T11:45:40.694514+00:00",name_original:"Africa",setting_top:e}],placesCities:[{id:h,id_image_cover:a,importance:d,slug:k,type_place:c,name:j},{id:635,id_image_cover:a,importance:d,slug:"akka",type_place:c,name:"Akka"},{id:633,id_image_cover:a,importance:d,slug:"auserd",type_place:c,name:"Auserd"},{id:631,id_image_cover:a,importance:d,slug:"bir-gandus",type_place:c,name:"Bir Gandús"},{id:637,id_image_cover:a,importance:d,slug:"bir-moghrein",type_place:c,name:"Bir Moghrein"},{id:634,id_image_cover:a,importance:d,slug:"el-marsa",type_place:c,name:"El-Marsa"},{id:p,id_image_cover:a,importance:d,slug:"laayoune",type_place:c,name:"Laâyoune"},{id:630,id_image_cover:a,importance:d,slug:"smara",type_place:c,name:"Smara"},{id:632,id_image_cover:a,importance:d,slug:"tarfaya",type_place:c,name:"Tarfaya"},{id:636,id_image_cover:a,importance:d,slug:"zouerat",type_place:c,name:"Zouérat"}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarEventComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023","city","biggest",true,5,440,629,66,"Ad-Dakhla","ad-dakhla","booking","zapadni-sahara","0%","state",628,6,"2024-03-01","1")));